import React from "react";
import Home1 from "../Images/home.svg";
import Home2 from "../Images/home2.svg";
import Home3 from "../Images/home3.svg";
import "../styles.css";
const About = () => {
  return (
    <div className="App mt-4">
      <div className="container">
        <div className="row">
          <div className="col-md-6 m-auto col-12 order-md-0 order-0">
            <figure>
              <img src={Home3} className="w-100  img-responsive " alt="image" />
            </figure>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
